CREATE FUNCTION public.refresh_union_view(table_name text) RETURNS void
    LANGUAGE plpgsql
    AS $$
        DECLARE
          schema TEXT;
          sql TEXT := '';
        BEGIN
          FOR schema IN SELECT schema_name FROM clients_client
          LOOP
            sql := sql || format('SELECT ''%I'' AS tenant, * FROM %I.%I UNION ALL ', schema, schema, table_name);
