-- Name: v_year_cumulative_totals_report; Type: VIEW; Schema: test; Owner: -
--

CREATE VIEW test.v_year_cumulative_totals_report AS
 SELECT m.year,
    m.quarter,
    m.month,
    m.location,
    m.type,
    m.value
   FROM ( SELECT v_project_successful_report.year,
            (0)::double precision AS quarter,
            (0)::double precision AS month,
            ''::character varying AS location,
            v_project_successful_report.type,
            sum(count(DISTINCT v_project_successful_report.type_id)) OVER (PARTITION BY v_project_successful_report.year ORDER BY v_project_successful_report.year, v_project_successful_report.type ROWS UNBOUNDED PRECEDING) AS value
           FROM test.v_project_successful_report
          GROUP BY v_project_successful_report.year, v_project_successful_report.type
        UNION
         SELECT v_task_successful_report.year,
            (0)::double precision AS quarter,
            (0)::double precision AS month,
            ''::character varying AS location,
            v_task_successful_report.type,
            sum(count(DISTINCT v_task_successful_report.type_id)) OVER (PARTITION BY v_task_successful_report.year ORDER BY v_task_successful_report.year, v_task_successful_report.type ROWS UNBOUNDED PRECEDING) AS value
           FROM test.v_task_successful_report
          GROUP BY v_task_successful_report.year, v_task_successful_report.type
        UNION
         SELECT v_taskmember_successful_report.year,
            (0)::double precision AS quarter,
            (0)::double precision AS month,
            ''::character varying AS location,
            'member_volunteers'::character varying AS type,
            sum(count(DISTINCT v_taskmember_successful_report.user_id)) OVER (PARTITION BY v_taskmember_successful_report.year ORDER BY v_taskmember_successful_report.year, v_taskmember_successful_report.type ROWS UNBOUNDED PRECEDING) AS value
           FROM test.v_taskmember_successful_report
          GROUP BY v_taskmember_successful_report.year, v_taskmember_successful_report.type
        UNION
         SELECT v_taskmember_successful_report.year,
            (0)::double precision AS quarter,
            (0)::double precision AS month,
            ''::character varying AS location,
            'taskmember_volunteers'::character varying AS type,
            sum(count(DISTINCT v_taskmember_successful_report.type_id)) OVER (PARTITION BY v_taskmember_successful_report.year ORDER BY v_taskmember_successful_report.year, v_taskmember_successful_report.type ROWS UNBOUNDED PRECEDING) AS value
           FROM test.v_taskmember_successful_report
          GROUP BY v_taskmember_successful_report.year, v_taskmember_successful_report.type
        UNION
         SELECT v_taskmember_successful_report.year,
            (0)::double precision AS quarter,
            (0)::double precision AS month,
            ''::character varying AS location,
            v_taskmember_successful_report.type,
            sum(sum(v_taskmember_successful_report.value)) OVER (PARTITION BY v_taskmember_successful_report.year ORDER BY v_taskmember_successful_report.year, v_taskmember_successful_report.type ROWS UNBOUNDED PRECEDING) AS value
           FROM test.v_taskmember_successful_report
          GROUP BY v_taskmember_successful_report.year, v_taskmember_successful_report.type) m
  ORDER BY m.year, m.type;


